import React, { useState, useEffect } from "react";
import MapContainer from "./MapContainer";
import {
  Container,
  Box,
  Button,
  Grid,
  RadioGroup,
  FormControlLabel,
  FormControl,
  Radio,
  FormLabel,
  Paper,
} from "@material-ui/core";
const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary,
  },
}));

const SearchPlace = () => {
  const [place, setPlace] = useState("심리상담소");
  const [selected, setSelected] = useState("심리상담소");
  const onChange = (e) => {
    setPlace(e.target.value);
    setSelected(e.target.value);
  };

  return (
    <>
      <MapContainer searchPlace={place} />

      <FormControl component="fieldset">
        {/* <FormLabel component="legend">내 주변 상담시설</FormLabel> */}
        <RadioGroup aria-label="hospital" name="searchKeyword1">
          <FormControlLabel
            value="심리상담소"
            control={<Radio color="primary" />}
            label="심리상담소"
            onChange={onChange}
            checked={selected == "심리상담소"}
          />
          <FormControlLabel
            value="정신건강의학과"
            control={<Radio color="primary" />}
            label="정신건강의학과"
            onChange={onChange}
            checked={selected == "정신건강의학과"}
          />
        </RadioGroup>
      </FormControl>
    </>
  );
};

export default SearchPlace;
